import React from 'react';
import styles from '../styles/Project1.module.css';

function Project1() {
  const notebookHtmlLink = "https://JamesGreen1210.github.io/portfolio/src/assets/ColabNotebooks/Welcome_To_Colaboratory.html";

  return (
    <div className={styles.project1}>
      <h1>Quantum Machine Learning Project</h1>
      {/* ... rest of your content */}
      <p>What issues have I ran into?</p>
      {/* ... rest of your content */}
      <iframe 
        src={notebookHtmlLink} 
        style={{ width: "100%", height: "2000px" }} 
        frameborder="0" 
        allowfullscreen 
        title="Jupyter Notebook"
      />
    </div>
  );
}

export default Project1;
